import React, { useState } from 'react'
import Validation from './Validation';

const App = () => {
  const [values, setValues] = useState({
    input: "",
  })
  const [errors, setErrors] = useState({})
  const handleInput = (event) => {
    console.log(event.target.value);
    // const newObj = { ...values, [event.target.name]: event.target.value }
    // setValues(newObj);
    // const {value , name } = event.target;
    setValues((preValue) => {
      // return [...values]
      if (name === "vessel") {
        return {
          vessel: value,
          quantity: preValue.quantity,
          offer: preValue.offer,
          terms: preValue.terms,
          advance: preValue.advance,
          balance: preValue.balance,
          days: preValue.days,
          lifting: preValue.lifting,
          expiry: preValue.expiry,
          address: preValue.address,
          hot: preValue.hot,
          listen: preValue.listen
        }
      }
    })


  }
  const handleValidation = (event) => {
    event.preventDefault();
    setErrors(Validation(values));
  }
  return (
    <>
      <div className="container">
        <div className="heading">
          <ul>
            <li>Buy</li>
            <li> <a href="#">Sell</a></li>
          </ul>
        </div>

        <form action="" className='submitform' onSubmit={handleValidation}>
          <div className="quantityform">
            <label htmlFor="vessel" >Vessel(s)<span>*</span></label>
            <input type="text" name='vessel' id="vessel" onChange={handleInput} value={values.vessel} required />
            {/* {errors.values && <p style={{ color: "red" }}>{errors.values}</p>} */}
            <label htmlFor="quantity" >Quantity<span>*</span></label>
            <input type="number" name='quantity' id="quantity" onChange={handleInput} value={values.quantity} required />
            {/* {errors.values && <p style={{ color: "red" }}>{errors.values}</p>} */}
            <label htmlFor="offer" >Offer Price...<span>*</span></label>
            <input type="number" name='offer' id="offer" onChange={handleInput} value={values.offer} required />
            {/* {errors.values && <p style={{ color: "red" }}>{errors.values}</p>} */}
          </div>

          <div className="balance">
            <label htmlFor="terms" > Payment Terms<span>*</span></label>
            <input type="text" name='terms' id="terms" onChange={handleInput} required value={values.terms} />
            <label htmlFor="advance" >Advance<span>*</span></label>
            <input type="number" name='advance' id="advance" onChange={handleInput} value={values.advance} required />
            <label htmlFor="balance" >Balance<span>*</span></label>
            <input type="number" name='balance' id="balance" onChange={handleInput} value={values.balance} required />
          </div>

          <div className="moreinformation">
            <label htmlFor="days" >No of Payment Days<span>*</span></label>
            <input type="number" name='days' id="days" onChange={handleInput} value={values.days} required />
            <label htmlFor="lifting" >Lifting days<span>*</span></label>
            <input type="number" name='lifting' id="lifting" onChange={handleInput} value={values.lifting} required />
            <label htmlFor="expiry">Expiry<span>*</span></label>
            <input type="number" name='expiry' id="expiry" onChange={handleInput} value={values.expiry} required />
          </div>

          <div className="address">
            <label htmlFor="address" >Address<span>*</span></label>
            <input type="text" placeholder='Tuna Port,kutch,Gujrat,370205' name='address' id="address" onChange={handleInput}
              value={values.address} required />
          </div>

          <div className="selectitem">
            <label htmlFor="hot" >Make Your Listing Hot? <span>*</span></label>
            <input type="checkbox" id="hot" name='hot' onChange={handleInput} required value={values.hot} /> Hot

            <label htmlFor="listen" >Post Your Listing On? <span>*</span> </label>
            <input type="checkbox" name="listen" id="listen" onChange={handleInput} value={values.listen} required />
          </div>

          <button type='submit'  >SUBMIT YOUR Product</button>

        </form>
      </div>
    </>
  )
}

export default App
